import React, {useEffect, useState} from 'react';
import { withRouter } from "react-router";

import ProductsList from "./ProductsList.jsx"
import ProductModals from "./ProductModals.jsx"

function Products(){

  const [currentProduct, setCurrentProduct] = useState({})
  const [isMenuOpen, setIsMenuOpen] = useState(false)
  const createProductInput = React.useRef(null);

  return( 
    <div>
      <ProductsList currentProduct={currentProduct} setCurrentProduct={setCurrentProduct} createProductInput={createProductInput} setIsMenuOpen={setIsMenuOpen} history/>    
      
      <ProductModals currentProduct={currentProduct} setCurrentProduct={setCurrentProduct} createProductInput={createProductInput} history/>
    </div>
  )
}

export default withRouter(Products);
